import base64
import gzip
import json
import zlib

# 



payload = ""

try:
    # decode from Base64
    decoded_data = base64.b64decode(payload)
    
    # decompressing with Gzip
    decompressed_data = gzip.decompress(decoded_data).decode('utf-8') 
    scorecard_data = json.loads(decompressed_data)

    print(json.dumps(scorecard_data, indent=2))  # Print the JSON data with indentation

except Exception as e:
    print("Error processing payload:", e)
